print(a)

"""### **2-B Quick Sort**"""

def partition(arr, start, end):
    pivot = arr[start]
    i, j =start+1, end
    while i <= j :
        while i <= end and arr[i] <= pivot: 
            i+= 1
        while j >= start and arr[j] > pivot :
            j -= 1
        if i < j :
            arr[i], arr[j] = arr[j], arr[i]
    arr[start], arr[j] = arr[j],  arr[start]
    return j

def quick_sort(a, p, r):
    if p == r: return a 
    if p < r:
        q = partition(a, p, r)
        quick_sort(a, p, q-1)
        quick_sort(a, q+1, r)

l = [1,5,6,8,9,2,4]
quick_sort(l, 0, len(l)-1)
print(l)

"""# **3. Counting the operations in Merge Sort and Quick Sort**

*   comp variable counts the number of comparsions
*   swaps variable counts the number of swaps
"""

comp = 0
swaps = 0
def compare(a, b):
  global comp
  comp += 1
  if a > b: return -1
  if b > a: return 1
  return 0

