"""# **Quick Sort Swaps**

Modified QuickSort after inserting the probes.
"""

comp, swaps = 0, 0
def partition_new(a, p, r):
    global swaps
    x = a[p]
    i, j = p+1, r
    while i <= j:
        while i < len(a) and compare(a[i], x) >= 0: i += 1;
        while j > -1 and compare(a[j], x) == -1: j -= 1;
        if i < j: a[i], a[j] = a[j], a[i]; swaps +=1
    a[p], a[j] = a[j], a[p]
    swaps += 1
    return j

def quick_sort_new(a, p, r):
    if compare(p, r) == 0: return a 
    if compare(p, r) == 1:
        q = partition_new(a, p, r)
        quick_sort_new(a, p, q-1)
        quick_sort_new(a, q+1, r)

